sparqlQueGG:
SELECT ?timezone WHERE {
  dbr:Salt_Lake_City dbo:timeZone ?timezone .
}

PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?mountain_name ?elevation 
WHERE {
  ?mountain dbo:country <http://dbpedia.org/resource/Germany> ; 
            dbo:elevation ?elevation ;
            rdfs:label ?mountain_name .
  FILTER(LANG(?mountain_name) = "en")
} 
ORDER BY DESC(?elevation)
LIMIT 1

SELECT ?occupation 
WHERE {
    ?person dbo:wikiPageID ?wikiPageID .
    ?person foaf:name "Franco Herbert"@it .
    ?person dbo:occupation ?occupation .
}

SELECT ?taiko ?description
WHERE {
  dbr:Taiko rdfs:label ?taiko .
  dbr:Taiko dbo:abstract ?description .
  FILTER (lang(?taiko) = "it" && lang(?description) = "it" )
}

SELECT ?seats WHERE {
  dbr:Estádio_do_Dragão dbo:seatingCapacity ?seats.
}

SELECT ?programma ?conta WHERE {
  {
    SELECT ?programma (COUNT(?airline) AS ?conta) WHERE {
      ?airline rdf:type dbo:Airline .
      ?airline dbo:alliance ?programma .
    }
    GROUP BY ?programma
  }
  ORDER BY DESC(?conta)
  LIMIT 1
}

SELECT ?airport ?airportLabel WHERE {
  ?airport dbo:location dbr:California ;
           a dbo:Airport.
  ?airport rdfs:label ?airportLabel.
  FILTER (lang(?airportLabel) = 'en')
}

SELECT ?nickname WHERE {
  dbr:San_Francisco dbo:nickname ?nickname .
}

SELECT ?maidenName WHERE {
  dbr:Angela_Merkel dbo:birthName ?maidenName .
}

PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX res: <http://dbpedia.org/resource/>

SELECT ?mayor
WHERE {
      res:Berlin dbo:leader ?mayor .
}

SELECT DISTINCT ?country ?countryLabel 
WHERE {
  ?country dct:subject dbc:Member_states_of_the_European_Union ;
            dbo:currency dbr:Euro .
  ?country rdf:type dbo:Country .
  OPTIONAL { 
    ?country rdfs:label ?countryLabel .
    FILTER(LANG(?countryLabel) = "it") 
  }
}
ORDER BY ?countryLabel

PREFIX dbp: <http://dbpedia.org/property/>
PREFIX dbr: <http://dbpedia.org/resource/>

SELECT ?software 
WHERE {
   ?software dbp:publisher dbr:Significant_Hamster_Software.
}

SELECT (COUNT(?grandchild) AS ?numGrandchildren)
WHERE {
    <http://dbpedia.org/resource/Jacques_Cousteau> dbo:child ?child .
    ?child dbo:child ?grandchild .
}

SELECT ?monarch ?spouse 
WHERE {
  ?monarch dbo:spouse ?spouse ;
           dct:subject dbc:Monarchs_of_the_United_Kingdom .
  ?spouse dbo:birthPlace ?birthPlace .
  ?birthPlace rdfs:label ?birthPlaceLabel .
  FILTER (lang(?birthPlaceLabel) = "en")
  FILTER (regex(str(?birthPlaceLabel),"Germany")) 
}

SELECT ?film ?filmLabel WHERE {
  ?film dbo:country dbr:Argentina.
  ?film rdf:type dbo:Film.
  SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],it". }
}

SELECT ?causeOfDeath WHERE {
  dbr:Michael_Jackson dbo:deathCause ?causeOfDeath.
}

PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX res: <http://dbpedia.org/resource/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?class WHERE {
    res:Millipede dbo:taxonClass ?class .
    SERVICE <http://dbpedia.org/> {
       ?class rdfs:label ?label .
       FILTER (lang(?label) = 'it')
    }
}

SELECT ?website
WHERE {
  <http://dbpedia.org/resource/Forbes> foaf:homepage ?website .
}

SELECT ?husband 
WHERE { 
  dbr:Amanda_Palmer dbo:spouse ?husband . 
  SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". } 
}

SELECT ?artist
WHERE {
  ?artwork dbo:author ?artist .
