}

SELECT DISTINCT ?informatico ?oscar WHERE { 
        ?informatico dbo:occupation dbr:Computer_scientist ;
                     dbo:award ?oscar .
        FILTER (CONTAINS(LCASE(STR(?oscar)), "academy award"))
    }

SELECT ?scrittore ?nomeScrittore WHERE {
  ?scrittore dbo:award dbr:Nobel_Prize_in_Literature .
  ?scrittore rdfs:label ?nomeScrittore .
  FILTER(lang(?nomeScrittore) = "it") 
}

SELECT ?alt_name
WHERE 
{
  <http://dbpedia.org/resource/Baghdad> dbo:alias ?alt_name .
  FILTER (lang(?alt_name) = "it")
}

SELECT ?city
WHERE {
  ?president dbp:office "President of Montenegro"@en .
