}

SELECT ?party ?partyLabel WHERE {
  ?party dct:subject category:Political_parties_in_the_Netherlands.
  ?party rdfs:label ?partyLabel.
  FILTER (lang(?partyLabel) = "it") 
}
LIMIT 100

SELECT (count(?satellite) as ?numberOfSatellites)
WHERE{ 
  dbr:Mars dbo:planetSatellite ?satellite . 
}

SELECT ?realName WHERE {
  dbr:Batman dbo:alias ?realName .
  FILTER(langMatches(lang(?realName),"IT"))
}

SELECT ?reason
WHERE {
  dbr:Elon_Musk dct:description ?reason .
  FILTER(LANG(?reason) = "it") 
}

SELECT ?state WHERE {
    dbr:Sean_Parnell dbo:office ?office .
    ?office dbo:location ?state .
