}

SELECT ?productionYears
WHERE { 
  dbr:Ford_Model_T dbo:productionStartYear ?startYear.
  dbr:Ford_Model_T dbo:productionEndYear ?endYear.
  BIND (year(?endYear) - year(?startYear) AS ?productionYears)
}

