PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbr: <http://dbpedia.org/resource/>
PREFIX dct: <http://purl.org/dc/terms/>
PREFIX geo: <http://www.w3.org/2003/01/geo/wgs84_pos#>

SELECT (COUNT(?river) as ?riverCount) (COUNT(?lake) as ?lakeCount) 
WHERE {
  { 
    ?river rdf:type dbo:River ;
           dct:subject <http://dbpedia.org/resource/Category:Rivers_of_South_Carolina> . 
  } 
  UNION 
  { 
    ?lake rdf:type dbo:Lake ;
          dct:subject <http://dbpedia.org/resource/Category:Lakes_of_South_Carolina> . 
  }
}

SELECT ?country ?capital
WHERE {
  ?country dct:subject dbc:Countries_in_Africa.
  ?country dbo:capital ?capital.
}

SELECT ?bridge WHERE {
  dbr:Manhattan_Bridge dbo:type ?type.
  ?bridge dbo:type ?type.
  FILTER (?bridge != dbr:Manhattan_Bridge)
}

SELECT ?libro ?numeroPagine WHERE {
    ?libro a dbo:Book.
    ?libro dbo:numberOfPages ?numeroPagine 
} 
ORDER BY DESC(?numeroPagine) 
LIMIT 1

